import React, {useState} from 'react';
import {Form, Button} from 'react-bootstrap';


export const Cow = () => {

  const [usernameReg, setUsernameReg] = useState('');
  const [passwordReg, setPasswordReg] = useState('');
  const [firstnameReg, setFirstnameReg] = useState('');
  const [lastnameReg, setLastnameReg] = useState('');
  const [emailReg, setEmailReg] = useState('');

  const register = (event) => {
    event.preventDefault()
    Axios.post('http://localhost:3001/register', {
      // username: usernameReg,
      // password: passwordReg,
      // first_name: firstnameReg,
      // last_name: lastnameReg,
      // email: emailReg,

    }).then((response)=>{
      console.log(response);
    })
  }


  return (
    <div>
      <Form>
            <Form.Group className="mb-3" controlId="formBasicEmail">
                <Form.Label>ID</Form.Label>
                <Form.Control type="number" placeholder="Enter First Name"/>


                <Form.Label>Staff ID</Form.Label>
                <Form.Control type="number" placeholder="Enter email"/>

                <Form.Label>Color</Form.Label>
                <Form.Control type="text" placeholder="Enter email"/>

                <Form.Label>Age</Form.Label>
                <Form.Control type="number" placeholder="Enter email"/>

                <Form.Label>Breed Name</Form.Label>
                <Form.Control type="text" placeholder="Enter Last Name"/>

                <Form.Label>Sex</Form.Label>
                <Form.Control type="text" placeholder="Enter Last Name"/>

                <Form.Label>Father's ID</Form.Label>
                <Form.Control type="number" placeholder="Enter email"/>

                <Form.Label>Mother's ID</Form.Label>
                <Form.Control type="number" placeholder="Enter email"/>

                <Form.Label>Date Of Birth</Form.Label>
                <Form.Control type="date" placeholder="Enter email"/>

                <Form.Label>Current Height</Form.Label>
                <Form.Control type="number" placeholder="Enter email"/>

                <Form.Label>Current Weight</Form.Label>
                <Form.Control type="number" placeholder="Enter email"/>

                <Form.Label>Total Milk</Form.Label>
                <Form.Control type="text" placeholder="Enter email"/>

                <Form.Label>Total Income</Form.Label>
                <Form.Control type="number" placeholder="Enter email"/>

                <Form.Label>Staff ID</Form.Label>
                <Form.Control type="number" placeholder="Enter email"/>

            </Form.Group>

            <Form.Group className="mb-3" controlId="formBasicPassword">
                <Form.Label>User Name</Form.Label>
                <Form.Control type="text" placeholder="Enter User Name"/>

            </Form.Group>
            <Button variant="primary" type="submit">
                Submit
            </Button>
        </Form>
    </div>
  )
}


export default Cow;
